import { useState } from "react";

export default function Test() {
  const [counter, setCounter] = useState(0);

  const clickHandler = () => {
    setCounter(counter + 1);
  };
  return (
    <div>
      <p id="counter">{counter}</p>
      <button onClick={clickHandler}>Increment</button>
    </div>
  );
}

